;
	lda     _pad1_new
	and     #$80
	bne     LCE5B
	lda     _pad1_new
	and     #$40
	bne     LCE5B
	lda     _pad1_zapper
	beq     LCE5C
	lda     _zapper_ready
	beq     LCE5C
LCE5B:	lda     #$01
LCE5C:	sta     _trigger_clicked
;
; if ((pad1_zapper) && (zapper_ready))
;
	lda     _pad1_zapper
	beq     LCDEF
	lda     _zapper_ready
	beq     LCDEF
;
; hit_detected = zap_read(1);
;
	lda     #$01
	jsr     _zap_read
	sta     _hit_detected
;
; if (debug_mode && hit_detected == 0)
;
LCDEF:	lda     _debug_mode
	beq     LCDFA
	lda     _hit_detected
	beq     LCE60
LCDFA:	rts
;
; hit_detected = (pad1 & PAD_A);
;
LCE60:	lda     _pad1
	and     #$80
	sta     _hit_detected
;
; }
;
	rts

